export default class BookStoreService {
    getBooks() {
        return [
            {id:1, name: 'Сказки', author: 'Alex Hitch', price: ''},
            {id:2, name: 'Комиксы', author: 'Boris Godunov'},
            {id:3, name: 'Анекдоты', author: 'Mary Strict'},
        ]
    }
}
